import './App.css';

const Home = () => {
  return (
  <div>
    <h1>Home</h1>
  </div>
  );
};

const About = () => {
  return (
  <div>
    <h1>About</h1>
  </div>
  );
};
function App() {
  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
